      B:\n\nExample.Com LLC\n5678 Random Drive\nNew York, NY 00000\nContact: Jane
      Doe, Managing Partner\nPhone: (012) 345-6789\nEmail: jane.doe@example.com\n\n1.
      Purpose:\n\nThe purpose of this Agreement is to protect the confidential information
      that may be disclosed between the parties during discussions and engagements
      regarding potential business collaborations and partnerships.\n\n2. Definition
      of Confidential Information:\n\nFor purposes of this Agreement, \"Confidential
